import React, { useState } from 'react';
import './App.css';
import Home from './pages/Home';
import PrivacyPolicy from './pages/PrivacyPolicy';
import Nav from './components/Nav';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  const [isConnected, setIsConnected] = useState(true); // This will toggle the navbar view

  return (
    <Router>
      <div className="App">
        <Nav userProfile={isConnected ? { name: 'John Doe', image: 'https://via.placeholder.com/40' } : null} handleLogout={() => setIsConnected(false)} />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/privacy-policy" component={PrivacyPolicy} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
